import React, { Component } from 'react'

class Profile extends Component {
  constructor(props) {
    super(props)

    this.state = {
      name: '',
      email: '',
    }
  }

  componentDidMount() {
    fetch('/api/users/:id')
      .then((response) => response.json())
      .then((data) => this.setState({ data }))
  }
}

export default Profile
